lient.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"1074"},"glyph":{"id":"1103"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1105"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1107"}},"id":"1106","type":"GlyphRenderer"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1468","type":"MonthsTicker"},{"attributes":{"source":{"id":"1150"}},"id":"1175","type":"CDSView"},{"attributes":{"coordinates":null,"group":null,"text":"Task Stream"},"id":"1114","type":"Title"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1122"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1125","type":"Grid"},{"attributes":{},"id":"1473","type":"BasicTickFormatter"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1244","type":"Line"},{"attributes":{"coordinates":null,"formatter":{"id":"1473"},"group":null,"major_label_policy":{"id":"1474"},"ticker":{"id":"1127"}},"id":"1126","type":"LinearAxis"},{"attributes":{},"id":"1095","type":"ResetTool"},{"attributes":{},"id":"1501","type":"Selection"},{"attributes":{"tools":[{"id":"1137"},{"id":"1139"},{"id":"1140"},{"id":"1141"},{"id":"1142"},{"id":"1143"}]},"id":"1130","type":"Toolbar"},{"attributes":{"callback":null},"id":"1092","type":"TapTool"},{"attributes":{"axis":{"id":"1193"},"coordinates":null,"group":null,"ticker":null},"id":"1196","type":"Grid"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1460"},{"id":"1461"},{"id":"1462"},{"id":"1463"},{"id":"14             else document.addEventListener("DOMContentLoaded", fn);
          })();
        </script>
